import React from 'react'
import homepic from "../img/homepagebg.png"

export default function Home() {
  return (
    <div className='h-auto'>
      <div className='h-full w-full'>
        <img className='objecy-cover' src={homepic} alt="renaissance"></img>
      </div>
    </div>
  )
}
